import React from 'react';

const Contact = ()=>{
    return(
        <>
         <div className='container'>
             <div className='row'>
                 <div className='col-lg-6 col-md-6 col-12'></div>
                 <div className='col-lg-6 col-md-6 col-12'></div>
             </div>
         </div>
        </>
    );
};
export default Contact;
